import image1 from "./assets/img1.jpg";
import image2 from "./assets/img2.jpg";
import image3 from "./assets/img3.jpg";


const data = {
  products: [
    {
      id: "1",
      name: 1,
      price: 15,
      image: image1,
    },
    {
      id: "2",
      name: 2,
      price: 15,
      image: image2,
    },
    {
      id: "3",
      name: 3,
      price: 15,
      image: image3,
    },
  ],
};
export default data;
